Here are 5 tips for how to do it properly.

‚òëÔ∏èStretch for 10 minutes every day. Regular stretching improves your balance, strength and flexibility.

‚òëÔ∏èWarm up your muscles before stretching. Try 10 minutes of gentle exercise like walking. Stretching cold muscles may result in injury.

‚òëÔ∏èHold a sustained stretch for 10 to 30 seconds. Don‚Äôt bounce when stretching. Overstretching causes muscle to contract and can cause small tears in fibres.

‚òëÔ∏èBreathe normally when stretching. Don‚Äôt try to hold your breath or perform special breathing exercises.

‚òëÔ∏èBalance your routine. Work opposing muscle groups each time you stretch. 

